import React from 'react'
import logo from './IMG/logo.png'
const Header = () =>{
    return (
        <>
        <div className="header">
         <h1><img src={logo} /> <span>Keep</span></h1>
         <input type="text" placeholder="search your note" />
        </div>
        </>
    )
}

export default Header;
